import "./card-list.style.scss";
import Card from '../card/card.component'

export const CardList = props => (
   <div className='card-list'>

  {props.players.map((player, ind)=><Card player={player.name} position={player.position} team = {player.team} counter={ind} addPlayer={props.addPlayer}/>)}
  </div>
);
